import React from 'react';
import { Layout} from 'antd';
import {
    BankOutlined,
    ArrowLeftOutlined,
    ArrowRightOutlined
  } from '@ant-design/icons';
import {Link} from "react-router-dom";

// http://315v841f37.zicp.vip/

class SeriesViewerTable extends React.Component {
    constructor(props) {
        super(props);
        this.setState.bind(this);
      }
      render() {
        const { Header } = Layout;
        return (
          <div>
             <Layout>
              <Header style={{ position: 'fixed', zIndex: 1, width: '100%' }}>
                <Link to='/studies'>
                  <BankOutlined style={{color:'white', fontSize:30}} mode="horizontal"/>
                </Link>
                <ArrowLeftOutlined style={{color:'white', fontSize:30}} mode="horizontal"/>
                <ArrowRightOutlined style={{color:'white', fontSize:30}}/>
              </Header>
            </Layout>

          </div>
          )
      }
}
export default SeriesViewerTable;
